import React from 'react';
import { Item,Segment } from 'semantic-ui-react';
import { Link } from 'react-router-dom';


import { IAffilie } from '../../../app/models/affilie';

const AffilieListItem: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {
  //const host = affilie.attendees.filter(x => x.isHost)[0];
  return (
    <Segment.Group>
      <Segment>
        <Item.Group>
          <Item>
            <Item.Content>
              <Item.Header as={Link} to={`/affilies/${affilie.cin}`}>
                {affilie.nom} {affilie.prenom}
              </Item.Header>
            </Item.Content>
          </Item>
        </Item.Group>
      </Segment>
    </Segment.Group>
  );
};

export default AffilieListItem;
